import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import notes from "../notes";
import Note from "./Note";

function newNotes(nDetail) {
  return (
    <Note key={nDetail.key} title={nDetail.title} content={nDetail.content} />
  );
}

function App() {
  return (
    <div>
      <Header />
      {notes.map((nDetail) => (
        <Note
          key={nDetail.key}
          title={nDetail.title}
          content={nDetail.content}
        />
      ))}
      <Footer />
    </div>
  );
}
export default App;
